package com.MITProjectService.admin.domain;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.io.Serializable;@Data@AllArgsConstructor@NoArgsConstructor@Entity@Table(name = "hello")public class Hello implements Serializable {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "id", nullable = false, updatable = false, unique = true, insertable = false)    private long id;    @Column(name = "name")    private String name;    @Column(name = "msg")    private String msg;    @Column(name = "privateKey")    private String privateKey;}